INSERT INTO `atari_2600` (`id`, `title`, `sears_title`, `code`, `designer_or_programer`, `publisher`, `year`, `genere`, `notes`, `image`) VALUES
(1, '32 in 1', '-', 'CX-26163', '', 'Atari', '1988', 'Educational, Sports', 'A multi-genre cartridge. It is a PAL-only release and is compatible with the Atari 7800.2 games are included, including games by Atari, Inc., Activision, CommaVid, and US Games.', ''),
(2, '3-D Tic-Tac-Toe', '3-D Tic-Tac-Toe', 'CX-2618', 'Carol Shaw', 'Atari', '1978', 'Strategy', '', ''),
(3, 'Action Pak', '-', 'PRO-810', '', 'Atari', '1981', 'Action, Strategy', 'Value priced re-release of Othello, Dodge \'Em, and Breakout.', ''),
(4, 'Adventure', 'Adventure', 'CX-2613', 'Warren Robinett', 'Atari', '1980', 'Adventure', 'Contains first well-known Easter egg, containing the designer\'s name.', ''),
(5, 'Air-Sea Battle', 'Target Fun', 'CX-2602', 'Larry Kaplan', 'Atari', '1977', 'Action', 'One of the nine Atari 2600 launch games.', ''),
